import React from "react";
import Navbar from "react-bootstrap/Navbar";
import Button from "react-bootstrap/Button";
import Nav from "react-bootstrap/Nav";
import Form from "react-bootstrap/Form";
import FormControl from "react-bootstrap/FormControl";
import InputGroup from "react-bootstrap/InputGroup";
import Card from "react-bootstrap/Card";
import "./header.css";

class Navigation extends React.Component {
  render() {
    return (
      <Navbar className="navigator" bg="light" expand="lg">
        <Nav.Link href="#home">
          <a class="btn icon-btn btn-default" href="#">
            <span class="glyphicon btn-glyphicon glyphicon-save img-circle text-muted"></span>
            Home
          </a>
        </Nav.Link>
        <Nav.Link href="#link">
          <i className="fa fa-wifi fa-1x"> Network</i>
        </Nav.Link>
        <Nav.Link href="#link">
          <i className="fa fa-ambulance fa-1x">Ask a doc</i>
        </Nav.Link>
        <Nav.Link href="#link">
          <i className="fa fa-hospital-o fa-1x">OncoKlinic</i>
        </Nav.Link>

        <Form inline>
          <i className="fas fa-search" aria-hidden="true"></i>
          <FormControl
            type="text"
            placeholder="Share here"
            className="mr-sm-2  text-center   "
          />
        </Form>
        <Nav.Link href="#link">
          <i className="fa fa fa-bell fa-1x"></i>
        </Nav.Link>
        <Nav.Link href="#link">
          <i className="fa fa-commenting-o fa-1x"></i>
        </Nav.Link>

        <Card>
          <div className="container">
            <div className="d-flex justify-content-center h-100">
              <div className="image_inner_container">
                <img src={require("../Profil/img/deadpool.jpg")} />
              </div>
            </div>
          </div>
        </Card>
      </Navbar>
    );
  }
}

export default Navigation;
